All that is needed is to write tests is to register them via the TM_UNIT_TEST_INTERFACE_NAME . You can find the interface in the unit_tests.h . TM_UNIT_TEST_INTERFACE_NAME expects a pointer of the type tm_unit_test_i . This interface expects a name and a function pointer to the test entry function. // Interface for running unit tests. To find all unit test, query the API registry for
// `TM_UNIT_TEST_INTERFACE_NAME` implementations.
typedef struct tm_unit_test_i
{ // Name of this unit test. const char *name; // Runs unit tests, using the specified test runner. The supplied allocator can be used for // any allocations that the unit test needs to make. void (*test)(tm_unit_test_runner_i *tr, struct tm_allocator_i *a);
} tm_unit_test_i; At this point, we have not tackled the following possible questions: Where and how do we register the interface? How could this interface look like? How does a test itself look like? Let us walk through those questions: Where and how do we register the interface? We need to register our tests in the same function as everything else that needs to be executed when a plugin loads: in our tm_load_plugin. It may look like this: #include <foundation/unit_test.h>
//...
// my amazing plugin
TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ tm_global_api_registry = reg; //... tm_add_or_remove_implementation(reg, load, TM_UNIT_TEST_INTERFACE_NAME, my_unit_tests);
} Here we register our test interface to the TM_UNIT_TEST_INTERFACE_NAME. How could this interface look like? After we have done this, all we need to do is declarer our my_unit_tests. It is as easy as it gets: #include <foundation/unit_test.h>
//...
tm_unit_test_i *entity_unit_test = &(tm_unit_test_i){ .name = "my_unit_tests", .test = test_function,
}; How does a test itself look like? All that's left is to write the test. Let us write this test. In its core all we need to do is write a function of the signature: (tm_unit_test_runner_i *tr, struct tm_allocator_i *a). In its body, we can define our tests. static void test_function(tm_unit_test_runner_i *test_runner, tm_allocator_i *allocator)
{ //.. code
} The test runner variable test_runner is needed to communicate back to the test suite about failures etc. The following macros will help you write tests. They are the heart of the actual tests. Macro Arguments Description TM_UNIT_TEST (test_runner, assertion) Unit test macro. Tests the assertion using the test runner test_runner. TM_UNIT_TESTF (test_runner, assertion, format, ...) As TM_UNIT_TEST() but records a formatted string in case of error. TM_EXPECT_ERROR (test_runner, error) Expect the error message error. If the error message doesn't appear before the next call to record(), or if another error message appears before it, this will be considered a unit test failure.Note that for TM_EXPECT_ERROR to work properly, you must redirect error messages to go through the test runner, so that it can check that the error message matches what's expected. It's time for some tests. Let us write some tests for carrays #include <foundation/unit_test.h>
#include <foundation/carray.inl>
//.. other code
static void test_function(tm_unit_test_runner_i *test_runner, tm_allocator_i *allocator)
{ /*carray*/ int32_t *a = 0; TM_UNIT_TEST(test_runner, tm_carray_size(a) == 0); TM_UNIT_TEST(test_runner, tm_carray_capacity(a) == 0); TM_UNIT_TEST(test_runner, a == 0); tm_carray_push(a, 1, &allocator); TM_UNIT_TEST(test_runner, tm_carray_size(a) == 1); TM_UNIT_TEST(test_runner, tm_carray_capacity(a) == 16); TM_UNIT_TEST(test_runner, a); TM_UNIT_TEST(test_runner, a[0] == 1); tm_carray_header(a)->size--; TM_UNIT_TEST(test_runner, tm_carray_size(a) == 0); TM_UNIT_TEST(test_runner, tm_carray_capacity(a) == 16); tm_carray_grow(a, 20, &allocator); tm_carray_header(a)->size = 20; TM_UNIT_TEST(test_runner, tm_carray_size(a) == 20); TM_UNIT_TEST(test_runner, tm_carray_capacity(a) == 32);
} All that's left is to build via tmbuild our plugin and watch the console output if our tests fail. This is how you integrate your tests into the whole build pipeline.

