typedef struct tm_integration_test_i
{ // Name of the test. const char *name; // Context that this test will run in. Tests will only be run in contexts that match their // `context` setting. tm_strhash_t context; // Ticks the test. The `tick()` function will be called repeatedly until all it's `wait()` calls // have completed. void (*tick)(tm_integration_test_runner_i *);
} tm_integration_test_i; At this point, we have not tackled the following possible questions: Where and how do we register the interface? How could this interface look like? How does a test itself look like? Let us walk those questions through: Where and how do we register the interface? We need to register our tests in the same function as everything else that needs to be executed when a plugin loads: in our tm_load_plugin. // my amazing plugin
